import logo from './logo.svg';
import './App.css';
import React from 'react';
import styled from "styled-components";
import Week from './Week';
import Detail from './Detail';


const list = [
  '목', '금', '토','일','월','화', '수'
]

console.log(list)

function App() {
  return (
    <div className="App">
      <Week/>
      <Circle/>
    </div>
  );
} 

const Circle = styled.div`
  width: 30px; 
  height: 30px; 
  border-radius: 30px; 
  margin: 5px; 
  background-color: rgb(255, 235, 59);
`;

export default App;
